import React, { useState, useEffect } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import './RestaurantResults.css';

const RestaurantResults = () => {
    const [restaurants, setRestaurants] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const location = useLocation();
    const navigate = useNavigate();
    const { searchLocation } = location.state || {};

    useEffect(() => {
        if (!searchLocation) {
            navigate('/');
            return;
        }

        const searchNearbyRestaurants = async () => {
            if (!window.google || !window.google.maps || !window.google.maps.places) {
                setError('Map services not initialized');
                return;
            }

            try {
                const map = new window.google.maps.Map(
                    document.getElementById('map'),
                    {
                        center: searchLocation.coordinates,
                        zoom: 14
                    }
                );

                const service = new window.google.maps.places.PlacesService(map);

                service.nearbySearch({
                    location: searchLocation.coordinates,
                    radius: 5000,
                    type: ['restaurant']
                }, (results, status) => {
                    setLoading(false);
                    if (status === window.google.maps.places.PlacesServiceStatus.OK) {
                        setRestaurants(results);

                        // Add markers for each restaurant
                        results.forEach(restaurant => {
                            const marker = new window.google.maps.Marker({
                                position: restaurant.geometry.location,
                                map: map,
                                title: restaurant.name
                            });

                            const infowindow = new window.google.maps.InfoWindow({
                                content: `
                                    <div>
                                        <h3>${restaurant.name}</h3>
                                        <p>${restaurant.vicinity}</p>
                                        <p>Rating: ${restaurant.rating ? `${restaurant.rating} ⭐` : 'No rating'}</p>
                                    </div>
                                `
                            });

                            marker.addListener('click', () => {
                                infowindow.open(map, marker);
                            });
                        });
                    } else {
                        setError('No restaurants found in this area');
                    }
                });
            } catch (err) {
                setLoading(false);
                setError('Error searching for restaurants');
                console.error('Search error:', err);
            }
        };

        searchNearbyRestaurants();
    }, [searchLocation, navigate]);

    return (
        <div className="results-page">
            <div className="results-header">
                <button onClick={() => navigate('/')} className="back-button">
                    <i className="fas fa-arrow-left"></i> Back to Search
                </button>
                <h1>Restaurants near {searchLocation?.address}</h1>
            </div>

            <div className="results-container">
                <div id="map" className="map-container"></div>

                <div className="restaurants-list">
                    {loading && <div className="loading">Searching for restaurants...</div>}

                    {error && (
                        <div className="error-message">
                            {error}
                        </div>
                    )}

                    {restaurants.map(restaurant => (
                        <div key={restaurant.place_id} className="restaurant-card">
                            {restaurant.photos?.[0] && (
                                <img 
                                    src={restaurant.photos[0].getUrl()}
                                    alt={restaurant.name}
                                    className="restaurant-image"
                                />
                            )}
                            <div className="restaurant-info">
                                <h3>{restaurant.name}</h3>
                                <p>{restaurant.vicinity}</p>
                                <div className="restaurant-details">
                                    <span className="rating">
                                        {restaurant.rating ? `${restaurant.rating} ⭐` : 'No rating'}
                                    </span>
                                    {restaurant.price_level && (
                                        <span className="price-level">
                                            {'$'.repeat(restaurant.price_level)}
                                        </span>
                                    )}
                                </div>
                                {restaurant.opening_hours && (
                                    <p className={`status ${restaurant.opening_hours.isOpen() ? 'open' : 'closed'}`}>
                                        {restaurant.opening_hours.isOpen() ? 'Open Now' : 'Closed'}
                                    </p>
                                )}
                            </div>
                        </div>
                    ))}
                </div>
            </div>
        </div>
    );
};

export default RestaurantResults;
